ن الصور.','Here you can choose gap between multiple line.'=>'هنا يمكنك اختيار الفجوة بين خط متعددة.','Here you can choose gap between pagination elements.'=>'هنا يمكنك اختيار الفجوة بين ترقيم الصفحات العناصر.','Here you can choose gap between texts.'=>'هنا يمكنك اختيار الفجوة بين النصوص.','Here you can choose how much images you would like to count in a minute.'=>'هنا يمكنك اختيار كم الصور التي ترغب في الاعتماد في دقيقة واحدة.','Here you can choose how much post show in the current page.'=>'هنا يمكنك اختيار مقدار ما بعد تظهر في الصفحة الحالية.','Here you can choose how much posts you would like to display per page.'=>'هنا يمكنك اختيار مقدار الوظائف التي ترغب في عرضها في كل صفحة.','Here you can choose how much speed in the typing text.'=>'هنا يمكنك اختيار مدى سرعة في كتابة النص.','Here you can choose how much text you would like to display for post content or excerpt.'=>'هنا يمكنك اختيار مقدار النص الذي ترغب في عرض محتوى آخر أو مقتطفات.','Here you can choose how much the scale on 3d effect.'=>'هنا يمكنك اختيار كم المقياس على تأثير 3d.','Here you can choose how much the translate z on 3d effect.'=>'هنا يمكنك اختيار مقدار ترجمة z على تأثير 3d.','Here you can choose how much words you would like to count in a minute.'=>'هنا يمكنك اختيار الطريقة الكثير من الكلمات التي ترغب في الاعتماد في دقيقة واحدة.','Here you can choose icon size.'=>'هنا يمكنك اختيار حجم الرمز.','Here you can choose icon wrapper width.'=>'هنا يمكنك اختيار أيقونة المجمع العرض.','Here you can choose image height.'=>'هنا يمكنك اختيار ارتفاع الصورة.','Here you can choose image horizontal position.'=>'هنا يمكنك اختيار صورة أفقي.','Here you can choose image vertical position.'=>'هنا يمكنك اختيار صورة الوضع العمودي.','Here you can choose image width.'=>'هنا يمكنك اختيار عرض الصورة.','Here you can choose interactivity with your Lottie animation.'=>'هنا يمكنك اختيار التفاعل مع لوتي الرسوم المتحركة.','Here you can choose list column for grid layout.'=>'هنا يمكنك اختيار قائمة عمود تخطيط الشبكة.','Here you can choose list item gap.'=>'هنا يمكنك اختيار قائمة البند الفجوة.','Here you can choose lottie height.'=>'هنا يمكنك اختيار لوتي الارتفاع.','Here you can choose lottie width.'=>'هنا يمكنك اختيار لوتي العرض.','Here you can choose mask shape for the image.'=>'هنا يمكنك اختيار شكل قناع على الصورة.','Here you can choose mask shape height.'=>'هنا يمكنك اختيار شكل قناع الارتفاع.','Here you can choose mask shape rotation.'=>'هنا يمكنك اختيار شكل قناع التناوب.','Here you can choose mask shape width.'=>'هنا يمكنك اختيار شكل قناع العرض.','Here you can choose play direction for your Lottie animation.'=>'هنا يمكنك اختيار اللعب الاتجاه الخاص بك لوتي الرسوم المتحركة.','Here you can choose play mode for your Lottie animation.'=>'هنا يمكنك اختيار طريقة اللعب الخاص بك لوتي الرسوم المتحركة.','Here you can choose renderer for your Lottie animation.'=>'هنا يمكنك اختيار العارض الخاص بك لوتي الرسوم المتحركة.','Here you can choose separator icon size.'=>'هنا يمكنك اختيار فاصل حجم الرمز.','Here you can choose size for checkbox and radio fields.'=>'هنا يمكنك اختيار حجم مربع و راديو المجالات.','Here you can choose stars size.'=>'هنا يمكنك اختيار النجوم الحجم.','Here you can choose stroke width.'=>'هنا يمكنك اختيار عرض السكتة الدماغية.','Here you can choose the contact form 7.'=>'هنا يمكنك اختيار نموذج الاتصال 7.','Here you can choose the custom height for flip box.'=>'هنا يمكنك اختيار ارتفاع مخصص للوجه المربع.','Here you can choose the fluent form.'=>'هنا يمكنك اختيار بطلاقة شكل.','Here you can choose the gap between days.'=>'هنا يمكنك اختيار الفجوة بين أيام.','Here you can choose the gravity form.'=>'هنا يمكنك اختيار شكل خطورة.','Here you can choose the ninja form.'=>'هنا يمكنك اختيار نموذج النينجا.','Here you can choose the size of load more spinner.'=>'هنا يمكنك اختيار حجم من تحميل المزيد من الدوار.','Here you can choose the wp form.'=>'هنا يمكنك اختيار نموذج الفسفور الابيض.','Here you can choose where to place the element.'=>'هنا يمكنك اختيار مكان وضع عنصر.','Here you can choose where to place the icon.'=>'هنا يمكنك اختيار مكان وضع الرمز.','Here you can choose whether or not add the icon for before text.'=>'هنا يمكنك اختيار ما إذا كان أو لا تضيف رمز قبل النص.','Here you can choose whether or not blur for circle slide control.'=>'هنا يمكنك اختيار ما إذا كان أو لم يكن طمس دائرة السيطرة الشرائح.','Here you can choose whether or not circle slide control.'=>'هنا يمكنك اختيار ما إذا كان أو لم يكن دائرة السيطرة الشرائح.','Here you can choose whether or not custom length for post content or excerpt text limit.'=>'هنا يمكنك اختيار ما إذا كان أو لا طول مخصصة محتوى آخر أو مقتطفات النص المحدد.','Here you can choose whether or not display the rating number after the stars.'=>'هنا يمكنك اختيار ما إذا كان أو لا يتم عرض تصنيف رقم بعد النجوم.','Here you can choose whether or not enable fade out instead of backspace effect.'=>'هنا يمكنك اختيار ما إذا كان أو عدم تمكين تتلاشى بدلا من backspace تأثير.','Here you can choose whether or not enable loop for the typing effect.'=>'هنا يمكنك اختيار ما إذا كان أو عدم تمكين حلقة عن كتابة المفعول.','Here you can choose whether or not enable Schema Support.'=>'هنا يمكنك اختيار ما إذا كان أو عدم تمكين دعم مخطط.','Here you can choose whether or not enable shuffle the string effect.'=>'هنا يمكنك اختيار ما إذا كان أو لا تمكن من خلط سلسلة تأثير.','Here you can choose whether or not include comments in reading time.'=>'هنا يمكنك اختيار ما إذا كان أو لا تشمل التعليقات في وقت القراءة.','Here you can choose whether or not load more button.'=>'هنا يمكنك اختيار ما إذا كان أو لا يتم تحميل المزيد من زر.','Here you can choose whether or not load more spinner at the visual builder.'=>'هنا يمكنك اختيار ما إذا كان أو لا يتم تحميل المزيد من الدوار في باني البصرية.','Here you can choose whether or not mark as a off day.'=>'هنا يمكنك اختيار ما إذا كان أو لم يكن علامة قبالة اليوم.','Here you can choose whether or not move both slide in slide Effect for flip box.'=>'هنا يمكنك اختيار ما إذا كان أو لم نقل كل الشرائح في تأثير الشريحة على الوجه مربع.','Here you can choose whether or not remove the cursor after completed the typing effect.'=>'هنا يمكنك اختيار ما إذا كان أو لم يكن إزالة المؤشر بعد الانتهاء من كتابة المفعول.','Here you can choose whether or not show avatar in the outside container.'=>'هنا يمكنك اختيار ما إذا كان أو لا تظهر الصورة الرمزية في خارج الحاوية.','Here you can choose whether or not show post excerpt.'=>'هنا يمكنك اختيار ما إذا كان أو لا تظهر مقتطف آخر.','Here you can choose whether or not show shadow for slide control.'=>'هنا يمكنك اختيار ما إذا كان أو لا تظهر الظل الشريحة التحكم.','Here you can choose whether or not show the button.'=>'هنا يمكنك اختيار ما إذا كان أو لا تظهر على زر.','Here you can choose whether or not show the conditional hidden fields in the visual  builder.'=>'هنا يمكنك اختيار ما إذا كان أو لا تظهر المشروط الحقول المخفية في باني البصرية.','Here you can choose whether or not show the cursor for the typing effect.'=>'هنا يمكنك اختيار ما إذا كان أو لا تظهر المؤشر على كتابة المفعول.','Here you can choose whether or not show the error and success messages in the visual  builder.'=>'هنا يمكنك اختيار ما إذا كان أو لا تظهر الخطأ ورسائل النجاح في باني البصرية.','Here you can choose whether or not show the form description.'=>'هنا يمكنك اختيار ما إذا كان أو لا تظهر على شكل الوصف.','Here you can choose whether or not show the form title.'=>'هنا يمكنك اختيار ما إذا كان أو لا تظهر على شكل عنوان.','Here you can choose whether or not show the icon with cursor for the typing effect.'=>'هنا يمكنك اختيار ما إذا كان أو لا تظهر أيقونة مع المؤشر عن كتابة المفعول.','Here you can choose whether or not show the label on hover effect.'=>'هنا يمكنك اختيار ما إذا كان أو لا تظهر التسمية على تأثير تحوم.','Here you can choose whether or not show the pagination.'=>'هنا يمكنك اختيار ما إذا كان أو لا تظهر ترقيم الصفحات.','Here you can choose whether or not show the separator between day and time text.'=>'هنا يمكنك اختيار ما إذا كان أو لا تظهر فاصل بين اليوم والوقت النص.','Here you can choose whether or not show the separator for day text.'=>'هنا يمكنك اختيار ما إذا كان أو لا تظهر على فاصل النص اليوم.','Here you can choose whether or not show the start and end time.'=>'هنا يمكنك اختيار ما إذا كان أو لا تظهر بداية ونهاية الوقت.','Here you can choose whether or not show the title text.'=>'هنا يمكنك اختيار ما إذا كان أو لا تظهر عنوان النص.','Here you can choose whether or not smoothness for slide control.'=>'هنا يمكنك اختيار ما إذا كان أو لم يكن نعومة على الشريحة التحكم.','Here you can choose whether or not the back side view first mode, by default "first side".'=>'هنا يمكنك اختيار ما إذا كان أو لم يكن الجانب الخلفي عرض الوضع الأول ، افتراضيا "الجانب الأول".','Here you can choose whether or not the image element is full width.'=>'هنا يمكنك اختيار ما إذا كان أو لم يكن عنصر الصورة هو العرض الكامل.','Here you can choose whether or not the image should open in Lightbox. Note: if you select to open the image in Lightbox, url options below will be ignored.'=>'هنا يمكنك اختيار ما إذا كان أو لم يكن صورة يجب أن تفتح في العلبة الخفيفة. ملاحظة: إذا قمت بتحديد فتح الصورة في العلبة الخفيفة, url الخيارات أدناه سيتم تجاهلها.','Here you can choose whether or not use 3D Content Effect for flip box.'=>'هنا يمكنك اختيار ما إذا كان أو عدم استخدام محتوى 3D تأثير الوجه المربع.','Here you can choose whether or not use background clip for the text.'=>'هنا يمكنك اختيار ما إذا كان أو عدم استخدام خلفية مقطع عن النص.','Here you can choose whether or not use clip for the text.'=>'هنا يمكنك اختيار ما إذا كان أو عدم استخدام كليب عن النص.','Here you can choose whether or not use custom height for flip box.'=>'هنا يمكنك اختيار ما إذا كان أو عدم استخدام ارتفاع مخصص للوجه المربع.','Here you can choose whether or not use icon for the post title.'=>'هنا يمكنك اختيار ما إذا كان أو عدم استخدام رمز عنوان آخر.','Here you can choose whether or not use label for image.'=>'هنا يمكنك اختيار ما إذا كان أو عدم استخدام تسمية الصورة.','Here you can choose whether or not use the ajax on form submission.'=>'هنا يمكنك اختيار ما إ